import React, { Component } from "react";
// import styled from "styled-components";


class ToDo extends Component {
    constructor(props) {
        super(props);
        this.state = {
            items: [],
        };
    }
    renderItems = () => {
        this.state.items.map((items) => {
            return(
                <li>
                    {}item 1 <button>Delete</button>
                </li>
            );
        });
    };
    render() {
        return (
            <>
                <h1>My To Do List</h1>
                <ul>
                    <li>
                        item 1 <button>Delete</button>
                    </li>
                    <li>
                        item 2 <button>Delete</button>
                    </li>
                    <li>
                        item 3 <button>Delete</button>
                    </li>
                    <li>
                        item 4 <button>Delete</button>
                    </li>
                    <li>
                        item 5 <button>Delete</button>
                    </li>
                    <li>
                        item 6 <button>Delete</button> 
                    </li>
                    <li>
                        item 7 <button>Delete</button>
                    </li>
                    <li>
                        item 8 <button>Delete</button>
                    </li>
                </ul>

                <input placeholder="new item"/>
                <button>Add new item</button>
            </>
        )
    }
}

export default ToDo
